let tasInputs;
let tassing = true;
let fps = 60;

function parseTASString() {
	tasInputs = [];
	let splittedString = tasString.split(' ');
	for (var j = 0; j < splittedString.length; j++) {
		tasInputs.push([]);
		for (var k = 0; k < splittedString[j].length; k++) {
			// splittedString[j].charAt(k);
			// tasInputs[j].push();
			switch (splittedString[j].charAt(k)) {
				case 'R':
				case '>':
					tasInputs[j].push(39);
					break;
				case 'L':
				case '<':
					tasInputs[j].push(37);
					break;
				case 'U':
				case '^':
					tasInputs[j].push(38);
					break;
				case 'D':
				case 'v':
					tasInputs[j].push(40);
					break;
				case 'J':
				case '_':
					tasInputs[j].push(32);
					break;
				case 's':
					tasInputs[j].push(16);
					break;
				case 'G':
					tasInputs[j].push(71);
					break;
				case 'Q':
					tasInputs[j].push(81);
					break;
				case 'S':
					tasInputs[j].push(83);
					break;
				case 'H':
					tasInputs[j].push(72);
					break;
				case 'M':
					tasInputs[j].push(77);
					break;
				case 'C':
					tasInputs[j].push(67);
					break;
				case 'Y':
					tasInputs[j].push(89);
					break;
				case 'X':
					tasInputs[j].push(88);
					break;
				case 'Z':
					tasInputs[j].push(90);
					break;
				case 'B':
					tasInputs[j].push(66);
					break;
				case '1':
					tasInputs[j].push(49);
					break;
				case '2':
					tasInputs[j].push(50);
					break;
				case '3':
					tasInputs[j].push(51);
					break;
				case 'd':
					tasInputs[j].push('mousedown');
					break;
				case 'u':
					tasInputs[j].push('mouseup');
					break;
				case 'm':
					tasInputs[j].push({
						x:parseInt(splittedString[j].substring(k+1, k+4)),
						y:parseInt(splittedString[j].substring(k+4, k+7))
					});
					k += 7;
					break;
			}
		}
	}
}

// So we can seed RNG.
// https://stackoverflow.com/questions/521295/seeding-the-random-number-generator-in-javascript
function sfc32(a, b, c, d) {
	return function() {
		a >>>= 0; b >>>= 0; c >>>= 0; d >>>= 0; 
		var t = (a + b) | 0;
		a = b ^ b >>> 9;
		b = c + (c << 3) | 0;
		c = (c << 21 | c >>> 11);
		d = d + 1 | 0;
		t = t + d | 0;
		c = c + t | 0;
		return (t >>> 0) / 4294967296;
	}
}

function cyrb128(str) {
    let h1 = 1779033703, h2 = 3144134277,
        h3 = 1013904242, h4 = 2773480762;
    for (let i = 0, k; i < str.length; i++) {
        k = str.charCodeAt(i);
        h1 = h2 ^ Math.imul(h1 ^ k, 597399067);
        h2 = h3 ^ Math.imul(h2 ^ k, 2869860233);
        h3 = h4 ^ Math.imul(h3 ^ k, 951274213);
        h4 = h1 ^ Math.imul(h4 ^ k, 2716044179);
    }
    h1 = Math.imul(h3 ^ (h1 >>> 18), 597399067);
    h2 = Math.imul(h4 ^ (h2 >>> 22), 2869860233);
    h3 = Math.imul(h1 ^ (h3 >>> 17), 951274213);
    h4 = Math.imul(h2 ^ (h4 >>> 19), 2716044179);
    return [(h1^h2^h3^h4)>>>0, (h2^h1)>>>0, (h3^h1)>>>0, (h4^h1)>>>0];
}

var seed = cyrb128('pong0'); // create seed
var seededRand = sfc32(seed[0], seed[1], seed[2], seed[3]);
function random() {
	return tassing?seededRand():Math.random();
}

